import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 28.2-302.6 Temporary license.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-302.6.md","filePath":"vacode/28.2-302.6.md"}'),o={name:"vacode/28.2-302.6.md"},i=r('<h1 id="§-28-2-302-6-temporary-license" tabindex="-1">§ 28.2-302.6 Temporary license. <a class="header-anchor" href="#§-28-2-302-6-temporary-license" aria-label="Permalink to &quot;§ 28.2-302.6 Temporary license.&quot;">​</a></h1><p>A. The Commission shall provide for issuance of a temporary saltwater recreational fishing license, which shall be valid for a stated period of time not to exceed ten consecutive days. The fee for the temporary license shall be five dollars or as subsequently revised by the Commission pursuant to § <a href="http://law.lis.virginia.gov/vacode/28.2-201/" target="_blank" rel="noreferrer">28.2-201</a>. Agents shall retain fifty cents as compensation for issuing each license.</p><p>B. All funds collected pursuant to this section shall be paid into the state treasury to the credit of the Virginia Saltwater Recreational Fishing Development Fund, as established by § <a href="http://law.lis.virginia.gov/vacode/28.2-302.3/" target="_blank" rel="noreferrer">28.2-302.3</a>.</p><p>1992, c. 895; 2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0009" target="_blank" rel="noreferrer">9</a>.</p>',4),s=[i];function n(l,c,h,d,p,_){return a(),t("div",null,s)}const u=e(o,[["render",n]]);export{m as __pageData,u as default};
